import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "./App.css";

export default function App() {
  return (
    <Router>
      <div>
        <nav className="madiv">
          <ul>
            <li>
              <Link to="/">HOME</Link>
            </li>
            <li>
              <Link to="/about">ABOUT ME</Link>
            </li>
            <li>
              <Link to="/resume">RESUME</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/resume">
            <Resume />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div className="accueil">
      <h4>Hello, I am </h4>
      <h2>AMRI</h2>
      <h4>
        I am
        <strong className="typist-element">
          {" "}
          Developer Web. Passionate about IT .
        </strong>
      </h4>
    </div>
  );
}

function About() {
  return <h2>About</h2>;
}

function Resume() {
  return <h2>Users</h2>;
}
